import React from "react";
import './Navbar.css';

function Navbar()
{
    return (
        <div className="navbar">
        <button onClick={()=>navigate('/login')}>Login</button>
        <button onClick={()=>navigate("/signup")}>Signup</button>
        </div>
    );
}

export default Navbar;
